import "../Styles.css";
import React, { useState } from 'react';
import ListGroup from 'react-bootstrap/ListGroup';
import {Footer} from "../components/Footer";

function UserList(){
    return(
    <div className="background">
    <h2 style={{paddingLeft: "2rem"}}> Users you are following </h2>
    <ListGroup as="ul" defaultActiveKey="#link1" style={{paddingLeft: "2rem", paddingRight: "20rem"}}>
      <ListGroup.Item as="li" >
        Cras justo odio
      </ListGroup.Item>
      <ListGroup.Item as="li">
        Dapibus ac facilisis in
        </ListGroup.Item>
      <ListGroup.Item as="li" >
        Morbi leo risus
      </ListGroup.Item>
      <ListGroup.Item as="li">
        Porta ac consectetur ac
        </ListGroup.Item>
    </ListGroup>

    </div>
    )
}

export default UserList
